## Description
Prior to [this commit](https://github.com/RoboJackets/robocup-software/pull/1661/commits/151ceb21c4429d16251de9ddb5733015d9bbd7af
) in #1661 , non-visible robots were being assigned to roles by gameplay, which led to the illusion that roleAssignment was not working at all. The role assignment system should know not to assign visible robots without customizing the cost functions.
